import {
  TEST_API,
  EXAMPLE
} from '../actions/types'

const initialState = {
  one: 'Zero'
}

const first = (state = initialState, action) => {
  let nextState = Object.assign({}, state)
  switch (action.type) {
    case TEST_API:
      return Object.assign({}, nextState, action.payload)
    case EXAMPLE:
      nextState.one = 'TEN'
      return nextState
    default:
      return state
  }
}

export default first
